import React, { useState, useRef } from 'react';
import Window from '../components/window';

export default function Main() {
  const [zIndex, setZIndex] = useState({});

  return (
    <>
      <Window zIndex={0} category="main" />
      <Window zIndex={999} category="chat-room" />
    </>
  );
}
